  alignItems: 'center',
  justifyContent: 'center',
});

const Typography = styled('span', {
  fontFamily: '$default',
  fontSize: 48,
  fontWeight: '$2',
  lineHeight: 1.4,
  color: '$veryPeri',
  textTransform: 'uppercase',
